import React, { Component } from 'react';
import AddTodo from './AddTodo'
import TodoList from './TodoList'
import Footer from './Footer'

const todos = [
  {
    id: 1,
    text: "学习react",
    completed: true
  },
  {
    id: 2,
    text: "学习redux",
    completed: false
  },
  {
    id: 3,
    text: "学习react router",
    completed: false
  },
];

const filter = "all"

class App extends Component {
  constructor(props) {
    super(props)
    this.state = {
      todos: []
    }
  }

  render() {
    const {todos} = this.props
    return (
      <div>
        <AddTodo />
        <TodoList todos={todos}/>
        <Footer filter={filter}/>
      </div>
    );
  }
}

export default App;
